class CompleteTripResponse {  String status;  String msg;  CompleteTripResponse({      this.status,       this.msg});  fromJson(dynamic json) {    status = json['status'];    msg = json['msg'];  }  Map<String, dynamic> toJson() {    var map = <String, dynamic>{};    map['status'] = status;    map['msg'] = msg;    return map;  }}